import React from 'react'
import { View, Text } from 'react-native'

export default function FlashcardsPracticeScreen(){
    return(
        <View style={{flex: 1, alignItems: 'center', justifyContent: 'center'}}>
            <Text>Practice Flashcards</Text>
        </View>
    )
}
